import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { faPlus } from '@fortawesome/free-solid-svg-icons';
import { AuthenticationService } from 'src/app/core/services/authentication.service';
import { ConfirmBoxModalService } from 'src/app/core/services/confirm-box-modal.service';
import { LocalStorageService } from 'src/app/core/services/local-storage.service';
import { ProjectService } from 'src/app/core/services/project/project.service';

@Component({
  selector: 'app-process-list',
  templateUrl: './process-list.component.html',
  styleUrls: ['./process-list.component.scss'],
})
export class ProcessListComponent {
  faPlus = faPlus;
  personalProcessBool: Boolean = false; //true: co quy trinh, false: chua co quy trinh
  projectList: Array<any> = []; //template 
  projectListByCreatorId: Array<any> = []; //project cua nguoi dung

  deletedProject: any;

  currentAction: string;

  constructor(
    private confirmSV: ConfirmBoxModalService,
    private projectSV: ProjectService,
    private authenSV: AuthenticationService,
    private localStorageSV: LocalStorageService,
    private router: Router
  ) {
    this.confirmSV.getMessage().subscribe((data) => {
      console.log('data: ', data);
      if(this.currentAction=="addnew") {
        if (data.action == 'close') {
          if (data.acceptance) {
            this.addNewProcess2();
          }
        }
      }
    });


    this.projectSV.getAllProjectByCreatorId(this.localStorageSV.getItem('userId')).subscribe((data: any) => {
      console.log("project list by creator id: ", data);
      if(data.length!=0) {
        this.projectListByCreatorId = data;
        this.personalProcessBool = true;
      } 
      this.projectSV.getProjectIstemplate().subscribe((data: any) => {
        this.projectList = data;
        console.log("project template: ", data);
      })
    })

    

  }

  confirmAddNewProcess(process: any) {
    this.currentAction = "addnew";
    this.confirmSV.sendMessage({
      isDisplay: true,
      message: {
        title: `${process.projectName}`,
        description: 'Bạn có muốn thêm quy trình này không?',
      },
    });
  }

  openTemplateProcessPage() {
    this.personalProcessBool = false;
  }

  addNewProcess2() {
    console.log('Add new process');
  }

  getAllProject() {
    this.projectSV.getAllProject().subscribe({
      next: (data: any) => {
        this.projectList = data;
        console.log('data:', this.projectList);
      },
      error: () => {
        console.log('error: getAllProject');
      },
    });
  }

  openProjectDetail(projectId: any) {
    this.localStorageSV.setItem("project", {projectId: projectId});
    this.router.navigateByUrl(`/farmer/process/detail`)
  }

  confirmDeleteProcess(process: any) {
    this.deletedProject = process;
    this.confirmSV.sendMessage({
      isDisplay: true,
      message: {
        title: `${process.projectName}`,
        description: 'Bạn có muốn xóa quy trình này không?',
      },
    });
  }

  deleteProcess(projectId: any) {
    
  } 
}
<div class="process-list" *ngIf="!personalProcessBool; else personalProcess">
  <div class="process-list__title">Chọn quy trình bắt đầu</div>
  <div class="process-list__list">
    <div class="process-list__list__item" *ngFor="let process of projectList">
      <div class="process-list__list__item__name-process">
        {{ process.projectName }}
      </div>
      <div class="process-list__list__item__duration">
        <span class="title">Thời gian: </span>
        <span class="value">{{ process.projectDuration }}</span>
      </div>
      <div class="process-list__list__item__action">
        <div class="process-list__list__item__action__detail-btn">Chi tiết</div>
        <div class="process-list__list__item__action__selection-btn" (click)="confirmAddNewProcess(process)" >Chọn</div>
      </div>
    </div>
  </div>
</div>

<ng-template #personalProcess>
  <div class="personal-process-list">
    <div class="personal-process-list__executing-process">
      <div class="personal-process-list__executing-process__title">
        Quy trình cá nhân
      </div>
      <div class="personal-process-list__executing-process__list">
        <div
          class="personal-process-list__executing-process__list__item"
          *ngFor="let process of projectListByCreatorId"
        >
          <div
            class="personal-process-list__executing-process__list__item__name-process"
          >
            {{ process.projectName }}
          </div>
          <div
            class="personal-process-list__executing-process__list__item__object"
          >
            <span class="title">Thời gian: </span>
            <span class="value">{{ process.projectDuration }}</span>
          </div>
          <div
            class="personal-process-list__executing-process__list__item__period"
          >
            <span class="title">Giai đoạn: </span>
            <span class="value"
              >{{ process.projectStartAt }} - {{ process.projectEndAt }}</span
            >
          </div>
          <div
            class="personal-process-list__executing-process__list__item__executing-date"
          ></div>
          <div
            class="personal-process-list__executing-process__list__item__action"
          >
          <div
            class="personal-process-list__executing-process__list__item__action__delete-btn"
            (click)="confirmDeleteProcess(process)"
          >
            Xóa
          </div>
            <div
              class="personal-process-list__executing-process__list__item__action__detail-btn"
              (click)="openProjectDetail(process.projectId)"
            >
              Chi tiết
            </div>
          </div>
        </div>
        <div
          class=" personal-process-list__executing-process__list__item personal-process-list__executing-process__list__item--add-new"
          (click)="openTemplateProcessPage()"
        >
          <fa-icon [icon]="faPlus"></fa-icon>
          Thêm quy trình
        </div>
      </div>
    </div>
    <div class="personal-process-list__recommendation-process"></div>
  </div>
</ng-template>
